import React, { useState, useEffect } from 'react';
import axios from 'axios';

import ClipLoader from "react-spinners/ClipLoader";

{isLoading ? (
  <ClipLoader color="#123abc" loading={isLoading} size={50} />
) : (
  <ul>
    {/* Render stock data */}
  </ul>
)}

const StockData = () => {
  const [stockData, setStockData] = useState([]);
  const [symbol, setSymbol] = useState('TSLA');

  useEffect(() => {
    axios
      .get(`http://127.0.0.1:5000/stocks?symbol=${symbol}`)
      .then((response) => setStockData(response.data))
      .catch((error) => console.error('Error fetching stock data:', error));
  }, [symbol]);

  return (
    <div>
      <h2>Stock Data</h2>
      <input
        type="text"
        value={symbol}
        onChange={(e) => setSymbol(e.target.value.toUpperCase())}
        placeholder="Enter stock symbol (e.g., TSLA)"
      />
      {stockData.body ? (
        <ul>
          <li><strong>Company Name:</strong> {stockData.body.companyName}</li>
          <li><strong>Exchange:</strong> {stockData.body.exchange}</li>
          <li><strong>Last Sale Price:</strong> {stockData.body.primaryData.lastSalePrice}</li>
          <li><strong>Net Change:</strong> {stockData.body.primaryData.netChange}</li>
          <li><strong>Percent Change:</strong> {stockData.body.primaryData.percentageChange}</li>
        </ul>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );

};

export default StockData;
